// Decode all portraits on load
export const PORTRAITS = {
  races: Object.fromEntries(
    Object.entries(PORTRAITS_DATA.races).map(([k, v]) => [k, decodeAscii(v)])
  ),
  raceClass: Object.fromEntries(
    Object.entries(PORTRAITS_DATA.raceClass).map(([k, v]) => [k, decodeAscii(v)])
  )
};

export function getPortrait(race, className = null) {
  if (className) {
    const key = `${race.toLowerCase()}-${className.toLowerCase()}`;
    return PORTRAITS.raceClass[key] || PORTRAITS.races[race.toLowerCase()] || null;
  }
  return PORTRAITS.races[race.toLowerCase()] || null;
}
